<script>
	import { mapState } from 'vuex';
    import 'swiper/dist/css/swiper.css';
    import { swiper, swiperSlide } from 'vue-awesome-swiper';
    import resize from 'vue-resize-directive';
    const SubscribeModal = () => import('@/components/modals/Subscribe.vue');
    const VideoModal = () => import('@/components/modals/Video.vue');
    const Office = () => import('@/components/career/Office.vue');
    const Work = () => import('@/components/career/Work.vue');
    const Interview = () => import('@/components/career/Interview.vue');

	export default {
        metaInfo: {
            title: 'Карьера.'
        },
        data () {
            return {
                sliderKey: window.innerWidth,
                teamSlider: {
                    observer: true,
                    slidesPerView: 2,
                    slidesPerColumn: 3,
                    spaceBetween: 46,
                    slidesPerColumnFill: 'row',
                    pagination: {
                        el: '.p-team-pagination',
                        clickable: true
                    },
                    allowTouchMove: false,
                    breakpoints: {
                        767: {
                            autoHeight: true,
                            slidesPerView: 1,
                            slidesPerColumn: 1,
                            allowTouchMove: true
                        },
                        1200: {
                            spaceBetween: 20
                        }
                    }
                },
                videoOpen: false,
                videoModalId: '',
                viewInterviews: [],
                selectedHandbk: {},
                introVideoID: 'g-1g3SDswGA', // id видео в блоке "Карьера"
            }
        },
        directives: {
            resize,
        },
        computed: {
            ...mapState([
                'directions',
            ]),
        },
        mounted() {
            this.teamAnimation();
        },
        methods: {
            //обновление слайдеров при изменении ширины окна
            updateSliders() {
                this.$nextTick(() => {
                    //обновляется ключ слайдеров для перерендера
                    this.sliderKey = window.innerWidth;
                });
            },
            //переход на страницу вакансий с выбором категории
            goVacancy(item) {
                //проверяем есть ли вакансии в категории
                if(item.count_main_vacancy > 0 || item.count_additional_vacancy !== 0) {
                    //переходим с указанием id выбранной категории
                    this.$router.push({ name: 'VacanciesList', params: { 'directionName': item.name } });
                }
            },
            //получение рандомного целого числа от min до max
            randomInt(min, max) {
                const randNumber = Math.random();
                return Math.floor(min + randNumber * (max + 1 - min));
            },
            //анимация иконок блока Команда
            teamAnimation() {
                const self = this,
                    shapeList = document.querySelectorAll('.p-team-img');
                for(let i = 0; i < shapeList.length; i++) {
                    shapeList[i].onmouseover = () => {
                        const timer = parseInt(shapeList[i].dataset.time), // длительность анимации
                              element = shapeList[i].querySelector('img'), // элемент с анимацией
                              animateLink = element.dataset.img, // ссылка на анимацию
                              staticLink = element.src; // ссылка на статическое изображение
                        //отключаем взаимоденйствие с элементом
                        shapeList[i].style.pointerEvents = 'none';
                        //отображаем анимацию на странице
                        element.src = animateLink;
                        // ждём завершения анимации
                        setTimeout(() => {
                            // возвращаем статику на страницу
                            element.src = staticLink;
                            // включаем взаимодействие со страницей
                            shapeList[i].style.pointerEvents = 'auto';
                        }, timer)
                    };
                }
            },
            //вызов функций при ресайзе страницы
            resizeFunction() {
                this.updateSliders();
                this.teamAnimation();
            },
            //открытие модального окна с подпиской на вакансию
            openSubscribeModal(direction) {
                //запоминаем данные вакансии с которой мы пришли
                if(direction) {
                    this.selectedHandbk = {
                        value: direction.id,
                        text: direction.name
                    };
                } else {
                    this.selectedHandbk = {};
                }
                this.$nextTick(() => {
                    this.$root.$emit('bv::show::modal', 'p-modal-subscribe');
                });
            },
            //открытие модального окна с видео
            openVideo(videoId) {
                this.videoModalId = videoId;
                this.$nextTick(() => {
                    this.$root.$emit('bv::show::modal', 'p-modal-video');
                });
            },
            //получение превью видео
            getYoutubePreview(videoID) {
                if(`https://img.youtube.com/vi/${videoID}/maxresdefault.jpg`) {
                    return `url('https://img.youtube.com/vi/${videoID}/maxresdefault.jpg')`
                }
                else if(`https://img.youtube.com/vi/${videoID}/sddefault.jpg`) {
                    return `url('https://img.youtube.com/vi/${videoID}/sddefault.jpg')`
                }
                else {
                    return false
                }
            },
        },
        components: {
            swiper,
            swiperSlide,
            SubscribeModal: SubscribeModal,
            VideoModal: VideoModal,
            Office: Office,
            Work: Work,
            Interview: Interview,
        }
    }
</script>

